pragma solidity ^0.5.0;

contract AddUser{

    struct User{
        string name;
        address payable account;
        string location;
        string phone;
        string email;
        uint accountType;       // Seller = 2 and Normal User = 1
    }

    mapping(address => User) public userAccount;

    event accountCreated(
        string name,
        address payable account,
        string location,
        string phone,
        string email,
        uint accountType
    );
    
    function createUser(string memory _name, string memory _location, string memory _phone, string memory _email,uint _type) public {
        require(bytes(_name).length > 0,"Name Length must be > 0");
        require(bytes(_location).length > 0,"location Length must be > 0");
        require(bytes(_phone).length > 9,"Phone Length must be > 9");
        require(bytes(_email).length > 0,"Email Length must be > 0");

        userAccount[msg.sender] = User(_name,msg.sender,_location,_phone,_email, _type);

        emit accountCreated(_name,msg.sender,_location,_phone,_email,_type);
    }

    function userExist(address _addr) public view returns (bool){
        return userAccount[_addr].account != address(0);
    }

    function makeSeller(address _addr) public {
        require(isSeller(_addr),"User does not exist");
        userAccount[_addr].accountType = 2;
    }

    function isSeller(address _addr) public view returns (bool){
        require(isSeller(_addr),"User does not exist");
        return userAccount[_addr].accountType == 2;
    }

}
